import React from 'react'

const DUMMY_EVENTS = [
    { id: 'e1', title: 'Some event 1' },
    { id: 'e2', title: 'Some event 2' },

]

function EventsPage() {
    return (
        <div>

            <h1>Events Page</h1>
            <ul>
                {DUMMY_EVENTS.map((data) => (
                    <>
                        <li> {data.id} </li>
                        <li> {data.title} </li>
                    </>
                ))}
            </ul>
        </div>
    )
}

export default EventsPage
